import React from 'react';

const ParkBoxStatus = (props) => {

  let result = "";

  const checkParkOpen = () => {
    if(props.park_open === true){
      result = "Open";
    }
      result = "Closed";
    }

    return (
        <>
          {result}
        </>
    );

}

export default ParkBoxStatus;
